import './App.css';
import { Main_Page, Ad_banner } from './Routes/Main.js';
import Header from './Components/Header.js';

// 주석 용도 내용 전달
// 기능 설명

function App() {
  return (
    <div className="App">

      {/* 메인페이지, 결과페이지 header div */}
      <Header/>

      <div>
        <Main_Page/>
        <Ad_banner/>
      </div>

    </div>
  );
}

export default App;
